import React from 'react';

const Register = () => {
  const goLogin = () => {
    window.location.href = "#/login"
  };

  const goHomepage = () => {
    window.location.href = "#/homepage"
  };

  return (
    <div>
      <div> now&nbsp;in&nbsp;register&nbsp;page </div>
      <div onClick={goLogin}> login </div>
      <div onClick={goHomepage}> homepage </div>
    </div>
  );
};

export default Register;
